  return (
    <div className='container-fluid'>
      <Header />
      <h1>Produtos</h1>
      <hr />
      <div className='row'>
        <div className='col-3'>
          <Categories />
        </div>
        <div className='col-9'>
          <CardProduct />
        </div>
      </div>
      <Footer class='mt-5' />
    </div>
  );
};

export default Produtos;
